const MissionTabBar = ({
  state,
  descriptors,
  navigation,
}: BottomTabBarProps) => {
  const { width: screenWidth, height: screenHeight } = useWindowDimensions();

  const renderIcon = (iconName: keyof typeof icons_map, isFocused: boolean) => {
    const svgWidth = 122;
    const svgHeight = 34;
    const aspectRatio = svgWidth / svgHeight;

    const width = screenWidth * 0.31;
    const height = width / aspectRatio;

    const textPath = icons_map[iconName].text;
    const iconPath = icons_map[iconName].icon;
    if (!(iconPath && textPath)) return null;

    return (
      <AnimatedMissionTabBarIcon
        iconPath={iconPath}
        textPath={textPath}
        width={width}
        height={height}
        isFocused={isFocused}
      />
    );
  };

  return (
    <View className="flex-row absolute top-0 right-0 left-0 justify-center items-center mt-12">
      {state.routes.map((route, index) => {
        const { options } = descriptors[route.key];
        const label =
          options.tabBarLabel !== undefined &&
          typeof options.tabBarLabel === "string"
            ? options.tabBarLabel
            : options.title !== undefined && typeof options.title === "string"
              ? options.title
              : route.name;

        const isFocused = state.index === index;

        const onPress = () => {
          const event = navigation.emit({
            type: "tabPress",
            target: route.key,
            canPreventDefault: true,
          });

          if (!isFocused && !event.defaultPrevented) {
            navigation.navigate(route.name, route.params);
          }
        };
        return (
          <TouchableOpacity
            key={`missions-${route.key}`}
            accessibilityRole="button"
            accessibilityState={isFocused ? { selected: true } : {}}
            accessibilityLabel={options.tabBarAccessibilityLabel}
            testID={options.tabBarButtonTestID}
            onPress={onPress}
            className="mx-[1.2] justify-center items-center"
          >
            {renderIcon(route.name as keyof typeof icons_map, isFocused)}
          </TouchableOpacity>
        );
      })}
    </View>
  );
};

export default MissionTabBar;
